import { NavigationContainer } from '@react-navigation/native'
import React from 'react'
import Tab from '../navigations/Tab'

const Navigation_Bottom = () => {
  return (
    <NavigationContainer>
      <Tab />
    </NavigationContainer>
  )
}

export default Navigation_Bottom
